  false,\n\t\"url\": null,\n\t\"notes\": \"This data set portrays an index to the
  U.S Geological Survey (USGS) 3.75 minute digital orthophoto quadrangle images that
  cover Idaho. These boundaries are sometimes referred to quarter-quadrangles. The
  Idaho Geospatial Data Clearinghouse has at least one 1-meter orthophoto for each
  quadrangle. The data set was created by merging together source files from the USGS-Boise
  office and the Idaho Department of Water Resources.\",\n\t\"license_title\": null,\n\t\"extras\":
